parser = English()

STOPLIST = set(stopwords.words('english') + ['n\'t', '\'s', '\'m', 'ca'] + list(ENGLISH_STOP_WORDS))
SYMBOLS = ' '.join(string.punctuation).split(' ') + ['-----', '---', '...', '“', '”', '\'ve']

def removeStrings(string, removeList):
    strList = string.split(' ')
    newList = []
    for item in strList:
        if not item in removeList:
            newList.append(item)
    newString = ' '.join(newList)
    return newString

def tokenizeText(sample):
    tokens = parser(sample)
    lemmas = []
    for tok in tokens:
        lemmas.append(tok.lemma_.lower().strip())
    tokens = [tok for tok in tokens if tok not in STOPLIST]
    tokens = [tok for tok in tokens if tok not in SYMBOLS]
    while "" in tokens:
        tokens.remove("")
    while " " in tokens:
        tokens.remove(" ")
    while "\n" in tokens:
        tokens.remove("\n")
    while "\n\n" in tokens:
        tokens.remove("\n\n")
    tokenStrings = [str(tok) for tok in tokens]
    for string in tokenStrings:
        string.replace(' ', '')
    newText = ' '.join(tokenStrings)
    return newText

def cleanUpText(inputText, rejectList):
    noRejects = removeStrings(inputText, rejectList)
    tokenized = tokenizeText(noRejects)
    return tokenized